import React from "react";
import { Routes } from "react-router";

interface TodosContainerProps {}

const TodosContainer: React.FC<TodosContainerProps> = (props) => {
  return (
    <>
      <nav>
        <ul>
          <li>OVERDUE</li>
          <li>ACTIVE</li>
          <li>FINISHED</li>
        </ul>
      </nav>
      {props.children}
    </>
  );
};

export default TodosContainer;
